import React, { useState } from 'react';
import './homepage.css'

export const ScheduleAppt = () => {
  const [fullName, setFullName] = useState("");
  const [selectedDate, setSelectedDate] = useState("");
  const [selectedTime, setSelectedTime] = useState("");

  const handleFullNameChange = (event) => {
    setFullName(event.target.value);
  };

  const handleDateChange = (event) => {
    setSelectedDate(event.target.value);
  };

  const handleTimeChange = (event) => {
    setSelectedTime(event.target.value);
  };

  const handleScheduleAppointment = () => {
    // Handle scheduling appointment logic here
    console.log("Scheduled appointment:", fullName, selectedDate, selectedTime);
  };

  return (
    <div>
      <div className="navbar">
        <div className="left">JSM's Chop Shop</div>
        <div className="right">
          <button onClick={() => setAction("Sign Up")}>Sign Up</button>
          <button onClick={() => setAction("Login")}>Login</button>
        </div>
      </div>
      <div className="main-content">
        <h2>Welcome to JSM's Chop Shop</h2>
        <p>Book your appointment now and get the perfect style!</p>
        <div className="appointment-form">
          <input
            type="text"
            placeholder="Full Name"
            value={fullName}
            onChange={handleFullNameChange}
          />
          <input
            type="date"
            placeholder="Date"
            value={selectedDate}
            onChange={handleDateChange}
          />
          <input
            type="time"
            placeholder="Time"
            value={selectedTime}
            onChange={handleTimeChange}
          />
          <button onClick={handleScheduleAppointment}>Schedule</button>
        </div>
      </div>
      <div className="footer">
        <p>&copy; 2024 JSM's Chop Shop. All rights reserved.</p>
      </div>
    </div>
  );
};
